import img1 from './photos/Instagram.png';
import Post from './Post';

function App() {
  return (

   <div className="app bg-stone-100 h-screen">
      <div className="app_header bg-white p-5 border-b-gray-300 border-b-2">
        <img src={img1} alt="" className="header_image object-contain"/>
      </div>
      <Post imgeurl="data:image/jpeg;base64," username="virat121" caption="ohh what a shot"/>
   </div>
  );
}

export default App;
